#[allow(dead_code)]
#[derive(Deserialize, Clone, Debug)]
struct GeoPoint {
    acc: StringF64,
    lat: StringF64,
    lon: StringF64,
    #[serde(rename = "rideStatus")]
    ride_status: String,
    speed: Option<SpeedInMeterPerSecond>,
    st: String,
}

#[derive(Serialize, Clone, Debug, PartialEq, PartialOrd, Copy)]
pub struct StringF64(pub f64);
impl<'de> Deserialize<'de> for StringF64 {
    fn deserialize<D>(deserializer: D) -> Result<Self, D::Error>
    where
        D: Deserializer<'de>,
    {
        use serde::de::{Error, Unexpected};

        struct SpeedVisitor;

        #[allow(clippy::needless_lifetimes)]
        impl<'de> serde::de::Visitor<'de> for SpeedVisitor {
            type Value = StringF64;

            fn expecting(&self, formatter: &mut std::fmt::Formatter) -> std::fmt::Result {
                formatter.write_str(
                    "a number (integer/float) or a string containing a floating-point number",
                )
            }

            fn visit_f64<E>(self, value: f64) -> Result<Self::Value, E>
            where
                E: Error,
            {
                Ok(StringF64(value))
            }

            fn visit_i64<E>(self, v: i64) -> Result<Self::Value, E> {
                Ok(StringF64(v as f64))
            }

            fn visit_u64<E>(self, v: u64) -> Result<Self::Value, E> {
                Ok(StringF64(v as f64))
            }

            fn visit_str<E>(self, value: &str) -> Result<Self::Value, E>
            where
                E: Error,
            {
                value
                    .parse::<f64>()
                    .map(StringF64)
                    .map_err(|_| Error::invalid_value(Unexpected::Str(value), &self))
            }
        }

        deserializer.deserialize_any(SpeedVisitor)
    }
}

#[test]
fn stop_detection_test() {
    let geo_points: Vec<GeoPoint> =
        serde_json::from_str(GEO_POINTS).expect("Failed to parse GEO_POINTS");

    let mut grouped_points: HashMap<TimeStamp, GeoPoint> = HashMap::new();
    for point in geo_points {
        let timestamp = TimeStamp(
            DateTime::parse_from_rfc2822(&point.st)
                .expect("Failed to parse timestamp")
                .with_timezone(&Utc),
        );
        grouped_points.insert(timestamp, point);
    }

    let mut sorted_points: Vec<(TimeStamp, GeoPoint)> = grouped_points.into_iter().collect();
    sorted_points.sort_by_key(|(st, _)| *st);
    sorted_points
        .retain(|(_, point)| point.acc < StringF64(50.0) && point.ride_status == "ON_RIDE");

    let mut stop_detection = None;
    for (index, (_, point)) in sorted_points.iter().enumerate() {
        let latest_driver_location = point.clone();
        let speed = point.speed; // Assuming speed is part of the point data

        let result = detect_stop(
            stop_detection,
            DriverLocation {
                location: Point {
                    lat: Latitude(latest_driver_location.lat.0),
                    lon: Longitude(latest_driver_location.lon.0),
                },
                timestamp: TimeStamp(Utc::now()),
            },
            speed,
            &StopDetectionConfig {
                stop_detection_update_callback_url: Url::parse("https://try.me").expect("DONE"),
                max_eligible_stop_speed_threshold: None,
                radius_threshold_meters: 200,
                min_points_within_radius_threshold: 5,
                enable_onride_stop_detection: true,
            },
        );
        stop_detection = result.1;

        if let Some(result_point) = result.0 {
            if distance_between_in_meters(
                &Point {
                    lat: Latitude(22.58534),
                    lon: Longitude(88.34397),
                },
                &result_point,
            ) < 200.0
            {
                println!(
                    "Stop detected at index {}: Point coordinates: ({}, {}), Speed: {:?}, Point: {:?}",
                    index, result_point.lat.0, result_point.lon.0, speed, point
                );
            }
        }
    }
}

#[test]
fn stop_detection_batched_test() {
    let geo_points: Vec<GeoPoint> =
        serde_json::from_str(GEO_POINTS).expect("Failed to parse GEO_POINTS");

    let mut grouped_points: HashMap<TimeStamp, GeoPoint> = HashMap::new();
    for point in geo_points {
        let timestamp = TimeStamp(
            DateTime::parse_from_rfc2822(&point.st)
                .expect("Failed to parse timestamp")
                .with_timezone(&Utc),
        );
        grouped_points.insert(timestamp, point);
    }

    let mut sorted_points: Vec<(TimeStamp, GeoPoint)> = grouped_points.into_iter().collect();
    sorted_points.sort_by_key(|(st, _)| *st);
    sorted_points
        .retain(|(_, point)| point.acc < StringF64(50.0) && point.ride_status == "ON_RIDE");

    // Process in batches of 6, starting from the end
    let batch_size = 6;
    let mut stop_detection = None;

    // Create batches from end, step by batch_size
    for batch_start in (0..sorted_points.len()).rev().step_by(batch_size) {
        // Calculate the start index for this batch
        let start_idx = batch_start.saturating_sub(batch_size - 1);

        // Get the batch slice
        let batch = &sorted_points[start_idx..=batch_start];

        // Process each point in the batch
        for (index, (_, point)) in batch.iter().enumerate() {
            let latest_driver_location = point.clone();
            let speed = point.speed;

            let result = detect_stop(
                stop_detection,
                DriverLocation {
                    location: Point {
                        lat: Latitude(latest_driver_location.lat.0),
                        lon: Longitude(latest_driver_location.lon.0),
                    },
                    timestamp: TimeStamp(Utc::now()),
                },
                speed,
                &StopDetectionConfig {
                    stop_detection_update_callback_url: Url::parse("https://try.me").expect("DONE"),
                    max_eligible_stop_speed_threshold: None,
                    radius_threshold_meters: 200,
                    min_points_within_radius_threshold: 5,
                    enable_onride_stop_detection: true,
                },
            );
            stop_detection = result.1;

            if let Some(result_point) = result.0 {
                if distance_between_in_meters(
                    &Point {
                        lat: Latitude(22.58534),
                        lon: Longitude(88.34397),
                    },
                    &result_point,
                ) < 200.0
                {
                    println!(
                        "Batch {}, Point {}: Stop detected at coordinates: ({}, {}), Speed: {:?}, Point: {:?}",
                        batch_start / batch_size,
                        index,
                        result_point.lat.0,
                        result_point.lon.0,
                        speed,
                        point
                    );
                }
            }
        }
    }
}
